import React, { Component } from 'react';
import PropTypes from 'prop-types';
import Typography from '@material-ui/core/Typography';
import RepoCard from './components/repoCard';
import {connect} from 'react-redux';
import {getRepos} from './../../reducers/repo.reducer';
import {getUser} from './../../reducers/user.reducer';
import {fetchRepos,starHandle} from './../../actions/repo.actions';
import CircularProgress from '@material-ui/core/CircularProgress';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: "24px" }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};


class ExploreProjects extends Component {
  constructor(props) {
    super(props);
    this.state={
      currentTab: 0,
    }
    this.props.dispatch(fetchRepos());
    this.handleStar=this.handleStar.bind(this);
    this.state = {
      currentTab : 0,
      header: "Trending",
    };
  }

  handleTabChange (tabNum)  {
    if (tabNum === 0) {
      this.setState({ currentTab: 0 });
      this.setState({ header: "Trending" });
    }
    else if (tabNum === 1) {
      this.setState({ currentTab: 1 });
      this.setState({ header: "New" });
    }
    else if (tabNum === 2) {
      this.setState({ currentTab: 2 });
      this.setState({ header: "Most Funded" });
    }
  };


  handleStar(id,cid){
    if(this.props.user.token===false || this.props.user.token===undefined){
      alert("Please sign in or sign up to star a repository");
    }
    else{
      this.props.dispatch(starHandle(id,this.props.user.token,cid));
    }
  }

  render() {
    return (
      <div className="ExploreProjects">
        <div className="PageTitle">
          <Typography id="overline">
          PROJECTS
          </Typography>
          <Typography variant="display4">
          {this.state.header}
          </Typography>
          <Tabs value={this.state.currentTab} indicatorColor="primary">
            <Tab label="Trending" onClick={()=>this.handleTabChange(0)}/>
            <Tab label="New" onClick={()=>this.handleTabChange(1)}/>
            <Tab label="Most Funded" onClick={()=>this.handleTabChange(2)}/>
          </Tabs>
        </div>
        <div className="MainExploreSection">
          <div className="ExploreRow">
            {this.props.repos===undefined || !this.props.repos  && <CircularProgress className="Spinner"/>}
            {this.props.repos!==false && this.props.repos!==undefined && this.props.repos.map(repo=>{
              let truth = false;
              if(this.props.user.user!==false && this.props.user.user!==undefined) if(this.props.user.user.starred.includes(repo.repoID.toString())){truth = true;}
              return <RepoCard
                key={repo.repoID} id={repo.repoID}
                cid={repo.cid} starred={truth}
                handleStar = {this.handleStar}
                props={this.props} RepoName={repo.project_name}
                RepoAuthor={repo.username} RepoDescription={"Repo description"}
                Language={"x"} Forks={repo.forks_count}
                Issues={"x"} SRCRaised={repo.src_raised}
                starCount={repo.star_count}
                />
            })}
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps =(state) =>{
  return{
    repos: getRepos(state),
    user: getUser(state)
  }
}
export default connect(mapStateToProps)(ExploreProjects);
